void Screen_Reset(bool enable)
{
    enable ? HAL_GPIO_WritePin(GPIOC,GPIO_PIN_6,GPIO_PIN_RESET) :
            HAL_GPIO_WritePin(GPIOC,GPIO_PIN_6,GPIO_PIN_SET);
}
void Screen_SetDataOrCommand(bool isData)
{
    isData ? HAL_GPIO_WritePin(GPIOC,GPIO_PIN_7,GPIO_PIN_SET) :
            HAL_GPIO_WritePin(GPIOC,GPIO_PIN_7,GPIO_PIN_RESET);
}
void WriteCommand(uint8_t _cmd)
{
    Screen_SetDataOrCommand(false);
    HAL_SPI_Transmit_DMA(&hspi2, &_cmd, 1);
}
void Write1Byte(uint8_t _data)
{
    Screen_SetDataOrCommand(true);
    HAL_SPI_Transmit_DMA(&hspi2, &_data, 1);
}
void Screen_SetWindow(uint16_t _startX, uint16_t _endX, uint16_t _startY, uint16_t _endY)
{
    uint8_t data[4];

    WriteCommand(0x2A); // COL_ADDR_SET
    data[0] = (_startX >> 8) & 0xFF;
    data[1] = _startX & 0xFF;
    data[2] = (_endX >> 8) & 0xFF;
    data[3] = _endX & 0xFF;
    WriteData(data, sizeof(data),1);

    WriteCommand(0x2B); // ROW_ADDR_SET
    data[0] = (_startY >> 8) & 0xFF;
    data[1] = _startY & 0xFF;
    data[2] = (_endY >> 8) & 0xFF;
    data[3] = _endY & 0xFF;
    WriteData(data, sizeof(data),1);

}
void WriteData(uint8_t* _data, uint32_t _len, bool _useDma)
{
	Screen_SetDataOrCommand(true);

	if (_useDma==1) {
			HAL_SPI_Transmit_DMA(&hspi2, _data, _len);
	} else {
			HAL_SPI_Transmit(&hspi2, _data, _len, 20);
	}
}
