int cnt1=0;
int cnt2=0;
void Screen_WriteFrameBuffer(uint8_t* _buffer, uint32_t _len, bool _isAppend)
{
	if (_isAppend) {
			WriteCommand(0x3C); // MEM_WR_CONT
	} else {
		cnt1++;
			WriteCommand(0x2C); // MEM_WR
	}

	WriteData(_buffer, _len, 0);
	cnt2++;
}



